import logo from './logo.svg';
import './App.css';
import data from './data';

function App() {
  return (
    <div>
      <header>
        <a href="/">Pet Adopt</a>
      </header>
      <main>
        <h1>Animale disponibile</h1>
        {data.pets.map((pet) => (
          <div>
            <img src={pet.image} alt={pet.name} />
            <p>{pet.name}</p>
          </div>
        ))}
      </main>
    </div>
  );
}

export default App;
